import React from "react";
import { Routes, Route } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { useEffect } from "react";
import Login from "./components/AccountManagement/login";
import ChoseType from "./components/AccountManagement/choseType";
import UserHomePage from "./components/UserHome/UserHomePage";

function App() {
  const navigate = useNavigate();
  useEffect(() => {
    navigate("/login");
  }, []);

  return (
    <Routes>
      <Route path="/" element={<Login />}></Route>
      <Route path="/login" element={<Login />} />
      <Route path="/choseAccount/:userid" element={<ChoseType />} />
      <Route path="/teacher/:userid" element={<UserHomePage />} />
      <Route path="/student/:userid" element={<UserHomePage />} />
    </Routes>
  );
}
export default App;
